import './Login.css';
import React from 'react';
import { Link, NavLink, BrowserRouter, Route, Routes } from 'react-router-dom';

const Login = () => {
    return (
        <>        
            <h2>Login</h2>            
            <p>이곳은 로그인 페이지 입니다.</p>            

            <NavLink to="./Sign_up">계정 만들기</NavLink>                  

        </>
    );
};

export default Login;
